import React from 'react'
import { TailwindThemeProvider, FillButton } from 'tailwind-react-ui'

export default function Header() {
  return (
    <div>
      <TailwindThemeProvider
        theme={{
          brandColors: {
            primary: 'red',
          },
        }}
      >
        <FillButton brand="primary">Red button</FillButton>
      </TailwindThemeProvider>
    </div>
  )
}
